css:
@-moz-document domain("http") {
body {
  white-space: pre;
  font-family: monospace;
  background: #393939; color: #ccc; 
}

.property {
  font-weight: bold;
  color: #dfcd8f;
}

.type-null {
  color: gray;
}

.type-boolean {
  color: firebrick;
}

.type-number {
  color: lime;
}

.type-string {
  color: #9cbc6b;
}

.callback-function {
  color: gray;
}

.collapser:after {
  content: "-";
}

.collapsed > .collapser:after {
  content: "+";
}

.ellipsis:after {
  content: " â€¦ ";
}

.collapsible {
  margin-left: 2em;
}

.hoverable {
  padding-top: 1px;
  padding-bottom: 1px;
  padding-left: 2px;
  padding-right: 2px;
  border-radius: 2px;
}

.hovered {
  background-color: rgba(51, 91, 11, 0.8);  
}

.collapser {
  padding-right: 6px;
  padding-left: 6px;
}
}
